// src/pages/About.jsx
import React from "react";

export default function About() {
  return (
    <section style={{ padding: "60px 0", width: "80%", margin: "0 auto" }}>
      <h2 style={{ color: "#127a3a", marginBottom: 20 }}>About Us</h2>
      <p style={{ color: "#444", lineHeight: 1.7 }}>
        <strong>Sooraj Crop Sciences</strong> is dedicated to empowering farmers
        with sustainable agricultural solutions. Our mission is to enhance crop
        productivity, improve soil health, and promote eco-friendly farming
        practices.
      </p>
    </section>
  );
}
